import React from "react";
import './Politics.css'
import Flag from "./Flag/Flag";
import Leader from "./Leader/Leader";
import Population from "./PopulationPie/Population";
class Politics extends React.Component{
    constructor(props) {
        super();

        this.props = props
    }

    render() {
        debugger;
        return (
            <div className="politics">

                <Flag src={this.props.store.flag}/>
                <Leader name={"Tyhon"} src={"images/leaders/caiser.png"}/>
                <Population partyPopulationData={this.props.store.ideologuesData.bind(this.props.store)}/>
            </div>
        );
    }
}
export default Politics;
